■商品説明■<br>


Reebok「リーボック」インスタ ポンプフューリーから、OPAL/WHITE/STEELカラー V69989 が入荷！！空気を注入することができるポンプチェンバーでシューレースがなくても足にフィットさせることができる「ポンプ テクノロジー」と、ハニカム構造で衝撃吸収性に優れた【HEXALITE】を搭載したランニングシューズ。優れた機能性、独特なデザイン性はスニーカーシーンに衝撃を与え、圧倒的な人気で90年代を牽引した注目の1足。レディースモデルですが、メンズの方にも使用できる、ビックサイズもご用意しております。今回は日本定価２０３０４円「税込み」のところ、数量限定特別価格にてご提供！■サイズについて■WOMANモデルですが、男性の方でも問題なく使用できます。ただ、通常のモデルより横幅が細身ですので、男性の方は、ご自分のサイズより、ワンサイズ上をお勧めいたします。<table width="100%" cellspacing="2" cellpadding="0" border="0">
