Reebok「リーボック」インスタ ポンプフューリーから、人気ドラマから着想を得たコラボモデルが登場！！80年代にメロドラマで人気を博した"ダイナスティ"をテーマに登場人物の"クリストル"をイメージしたプレミアムレザーとピンクのソールが女性らしい一足に仕上げてくれる、コペンハーゲンのスニーカーショップ、ネイキッドとのコラボアイテム！入荷数は少なめですのでお早めに！<table width="100%" cellspacing="2" cellpadding="0" border="0">
