■商品説明■<br>



１９９４年にリーボックから発売され一世を風靡したPUMP FURY「ポンプ フューリー」から、ゴールドをワンポイントに使用したゴージャスな1足が登場！。波模様が描かれたレザーをアッパーに使用し、ワンポイントのゴールドはヒールカウンター部分に配色されております。日本ではBeauty&Youthのみで発売され、生産数の少ないレアモデルです！今回は「２５cm」「２５，５cm」の２サイズ限定で激安価格にてご提供！■サイズについて■WOMANモデルですが、男性の方でも問題なく使用できます。ただ、通常のモデルより横幅が細身ですので、男性の方は、ご自分のサイズより、ワンサイズ上をお勧めいたします。<table width="100%" cellspacing="2" cellpadding="0" border="0">
