NEW BALANCE「ニューバランス」から日本未発売！海外限定カラー！ML574BGS ネイビー/グレーカラーが入荷！ニューバランスの伝統的モデル「５７４」。素材にはスエードをベースにメッシュの組み合わせを用いている生産数の少ない希少なモデル。ベーシックなランニングスタイルと快適な履き心地に特化し計算尽くされたフォルムがランナーから絶大的な信頼を得るモデル。クッション性の高い履き心地抜群のスニーカーです。即完売必見ですのでどうぞお早めに！こちらのワイズ「横幅サイズ」：Ｄワイズです。「通常幅」<table width="100%" cellspacing="2" cellpadding="0" border="0">
